import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter section
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Wait for min and max price inputs
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Clear and set min price
    const minPriceInput = await page.$('#minPrice');
    await minPriceInput.click({ clickCount: 3 });
    await minPriceInput.fill('100');

    // Clear and set max price
    const maxPriceInput = await page.$('#maxPrice');
    await maxPriceInput.click({ clickCount: 3 });
    await maxPriceInput.fill('500');

    // Take screenshot after entering price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_entered_price_range.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_entered_price_range.png'));

    // Click the "Apply" button
    // Try by text, fallback to class
    let applyBtn = await page.$('button:has-text("Apply")');
    if (!applyBtn) {
      applyBtn = await page.$('.apply-filter');
    }
    if (applyBtn) {
      await applyBtn.click();
    }

    // Wait for product grid/list to update (look for .products-grid or .products-list)
    await page.waitForSelector('.products-grid, .products-list', { timeout: 5000 });

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_apply_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_apply_filter.png'));

    // Extract product titles and prices currently visible
    let products = [];
    // Try grid view first
    if (await page.$('.products-grid')) {
      products = await page.$$eval('.products-grid .product-card', cards =>
        cards.map(card => {
          const title = card.querySelector('.product-title')?.innerText || '';
          const priceText = card.querySelector('.product-price')?.innerText || '';
          // Extract numeric price
          const match = priceText.match(/\$([0-9,.]+)/);
          const price = match ? parseFloat(match[1].replace(/,/g, '')) : null;
          return { title, price };
        })
      );
    } else if (await page.$('.products-list')) {
      products = await page.$$eval('.products-list .product-card-list', cards =>
        cards.map(card => {
          const title = card.querySelector('.product-title')?.innerText || '';
          const priceText = card.querySelector('.product-price')?.innerText || '';
          const match = priceText.match(/\$([0-9,.]+)/);
          const price = match ? parseFloat(match[1].replace(/,/g, '')) : null;
          return { title, price };
        })
      );
    }

    // Filter out products with null price
    products = products.filter(p => p.price !== null);

    // Verify all prices are within the applied range
    const minPrice = 100;
    const maxPrice = 500;
    const allWithinRange = products.every(p => p.price >= minPrice && p.price <= maxPrice);

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and extracted filtered product data",
      extractedData: {
        filteredProducts: products,
        allPricesWithinRange: allWithinRange
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
